import React from "react";
import profileImg from "../../assets/profileImg.JPG"

require("./contact.css");


const contact = () => {
    return (
        <div id="bioMainContainer">
            <div className="row">
                <div className="col-sm-12 col-md-12 col-lg-7 d-flex justify-content-center">

                </div>
                <div className="col-sm-12 col-md-12 col-lg-5">
                    <iframe src="https://snazzymaps.com/embed/27427" width="100%" height="600px" style="border:none;"></iframe>
                </div>
            </div>
        </div>
    )
}

export default contact;
